"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Orthostatic hypotension (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/orthostatic-hypotension-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H12521499\">",
"      <span class=\"h1\">",
"       What is orthostatic hypotension?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Orthostatic hypotension is a sudden drop in blood pressure that happens when a person stands up. This drop in blood pressure can make you feel dizzy or lightheaded. It can even make you pass out. Another term for orthostatic hypotension is &ldquo;postural hypotension.&rdquo;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12521506\">",
"      <span class=\"h1\">",
"       What are the symptoms of orthostatic hypotension?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms all happen when you stand up. They can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Feeling lightheaded or dizzy",
"       </li>",
"       <li>",
"        Blurry or dim vision",
"       </li>",
"       <li>",
"        Weakness",
"       </li>",
"       <li>",
"        Fainting (this is called syncope)",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12521513\">",
"      <span class=\"h1\">",
"       What can cause orthostatic hypotension?",
"      </span>",
"      &nbsp;&mdash;&nbsp;There are many causes of orthostatic hypotension. It can happen if:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        There is not enough fluid in your arteries &mdash; This can happen if you lose blood or if you are &ldquo;dehydrated,&rdquo; meaning you do not have enough fluids. You can become dehydrated if:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        You do not drink enough fluids",
"       </li>",
"       <li>",
"        You have severe diarrhea or vomiting",
"       </li>",
"       <li>",
"        You sweat a lot (for example, during exercise)",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Your heart doesn&rsquo;t pump strongly enough",
"       </li>",
"       <li>",
"        The nerves and hormones in your body that control the blood vessels are not working properly",
"       </li>",
"       <li>",
"        You take certain medicines",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      In some people, orthostatic hypotension is tied to another problem, such as diabetes or Parkinson disease. But people who are otherwise healthy can have the condition, too. Older people are more likely than younger people to have orthostatic hypotension.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12521520\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If you feel dizzy or like you might pass out when you stand up, see your doctor or nurse. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12521527\">",
"      <span class=\"h1\">",
"       Is there a test for orthostatic hypotension?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. There are a few tests that can help your doctor or nurse find out if orthostatic hypotension is causing your symptoms. The simplest test is to take your blood pressure and pulse while you are sitting or lying down and then again after you stand up. Other tests could include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Blood tests to see if you have a condition called &ldquo;anemia,&rdquo; which happens if you have too few red blood cells",
"       </li>",
"       <li>",
"        Blood tests to check that your blood has the right chemical balance and that your fluid levels are in the right range",
"       </li>",
"       <li>",
"        Tests to make sure your heart is pumping correctly",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12521534\">",
"      <span class=\"h1\">",
"       How is orthostatic hypotension treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The first thing your doctor or nurse will want to do to &ldquo;treat&rdquo; your orthostatic hypotension is find out if it is caused by any medicines you take. If so, he or she might switch you to another medicine or lower your dose. Medicines that can cause orthostatic hypotension include those used to treat:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        High blood pressure",
"       </li>",
"       <li>",
"        Chest pain caused by heart disease (called &ldquo;angina&rdquo;)",
"       </li>",
"       <li>",
"        Depression",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      There are also medicines to treat orthostatic hypotension directly. If necessary, your doctor or nurse can prescribe 1 of these medicines.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12521541\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. There are a few things you can do to reduce the problems caused by orthostatic hypotension (listed below). But you should try these things only after talking to your doctor or nurse.",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Stand up slowly and give your body time to adapt. This is especially important when you get out of bed in the morning. Start by sitting up and waiting a moment. Then swing your legs over the side of the bed and wait some more. When you do stand up, make sure you have something to hold onto in case you start to feel dizzy.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Avoid running, hiking, or doing anything that takes a lot of energy in hot weather. These things can make orthostatic hypotension worse.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Make sure you drink enough fluids, especially in hot weather.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Put blocks under the posts at the head of your bed. This will raise your head above your heart slightly.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Wear &ldquo;compression&rdquo; stockings; ones that go to your waist are most helpful, but they are hard to wear.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Avoid drinking much alcohol.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H12521548\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
