"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Infertility in couples (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/infertility-in-couples-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H459785398\">",
"      <span class=\"h1\">",
"       Why are we having trouble getting pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Getting pregnant depends on both the woman and the man. A couple might not be able to get pregnant because of an issue with the man&rsquo;s body, the woman&rsquo;s body, or both.",
"     </p>",
"     <p>",
"      When a couple has trouble getting pregnant, doctors often do tests in both partners to try to figure out the cause. But even with tests, doctors sometimes cannot figure out why a couple can&rsquo;t get pregnant.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H459785405\">",
"      <span class=\"h1\">",
"       When should we see a doctor?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most doctors recommend that a couple begin having tests if they cannot get pregnant after having unprotected sex for one year. But if you are worried, talk with your doctor or nurse. He or she might recommend that you have tests done sooner. Tests are done sooner in women over 35. Tests are also done sooner in women who don&rsquo;t have a period every month.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H459785412\">",
"      <span class=\"h1\">",
"       What tests are done for men?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you are a man, your doctor will ask you questions about your health and sex history, and do an exam. He or she will often order a test to check how many sperm you make and how healthy your sperm are.",
"     </p>",
"     <p>",
"      Other tests that a man might have include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Blood tests &ndash; Some blood tests check male hormone levels. Abnormal hormone levels can make it hard to get your partner pregnant. Other blood tests can check if you have a genetic condition that can make it hard to get your partner pregnant.",
"       </li>",
"       <li>",
"        Ultrasound &ndash; This imaging test creates pictures of the inside of the body and can check if a sex organ is abnormal (",
"        <a class=\"graphic graphic_figure graphicRef68075 \" href=\"UTD.htm?21/43/22194\">",
"         figure 1",
"        </a>",
"        ). For example, some men have a block in a structure called the &ldquo;vas deferens,&rdquo; which is the tube that sperm needs to travel through. &nbsp;",
"       </li>",
"       <li>",
"        Urine tests &ndash; Urine tests can check if sperm are moving in the wrong direction and going back into the bladder during sex instead of out the penis.",
"       </li>",
"       <li>",
"        Biopsy &ndash; A biopsy might be done if a sperm test shows that a man has zero or a very small amount of sperm. During a biopsy, a doctor collects a small tissue sample from inside the testicle. Then the doctor can look at the sample under a microscope to check if sperm are present.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H459785419\">",
"      <span class=\"h1\">",
"       What tests are done for women?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you are a woman, your doctor will ask you questions about your health, monthly periods, and sex history. He or she will also do an exam.",
"     </p>",
"     <p>",
"      Women might then have one or more of the following tests:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Blood tests &ndash; Blood tests can check female hormone levels. Abnormal hormone levels can make it hard to get pregnant. Blood tests can also be done to check for genetic problems that can make it hard to get pregnant.",
"       </li>",
"       <li>",
"        Ovulation tests &ndash; Different tests can be used to check if a woman is ovulating. Ovulation is when an egg is released from the ovary into the fallopian tube (",
"        <a class=\"graphic graphic_figure graphicRef80271 \" href=\"UTD.htm?14/52/15171\">",
"         figure 2",
"        </a>",
"        ). It needs to occur for a woman to get pregnant (",
"        <a class=\"graphic graphic_figure graphicRef73238 \" href=\"UTD.htm?3/50/3876\">",
"         figure 3",
"        </a>",
"        ).",
"       </li>",
"       <li>",
"        Tests to check the uterus and fallopian tubes &ndash; These tests are described below. Problems with the fallopian tubes and uterus can make it hard to get pregnant. For example, some women are born with an abnormally-shaped uterus (",
"        <a class=\"graphic graphic_figure graphicRef59667 \" href=\"UTD.htm?4/3/4144\">",
"         figure 4",
"        </a>",
"        ). Or women might have blocked fallopian tubes from past infections or surgery.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H459785426\">",
"      <span class=\"h1\">",
"       What tests check the uterus and fallopian tubes?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Doctors can do different tests to check for problems with the uterus and fallopian tubes. These include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Ultrasound, X-ray, or other imaging tests &ndash; These tests can create pictures of the inside of the body and can check for blockages or other problems.",
"       </li>",
"       <li>",
"        Tests that look inside the body &ndash; These tests are not as simple as imaging tests, because they involve procedures. A doctor can look inside the body using a small tube with a camera on the end. He or she can put the tube into the vagina, past the cervix, and up into the uterus to look at the inside of the uterus. He or she can also put the tube through a small opening in the skin in the lower part of the belly to look at the outside of the uterus, fallopian tubes, and ovaries.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H459785433\">",
"      <span class=\"h1\">",
"       What happens after the tests are done?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Test results might show that one or both partners have a problem that can be treated. In that case, treatment will likely be aimed at fixing that problem.",
"     </p>",
"     <p>",
"      Some people might have a problem that can&rsquo;t be treated. Or the tests might not show what the problem is. In these cases, there are other treatments that doctors can do to help couples get pregnant. Talk with your doctor about different treatment options so that you can choose which treatment is right for you.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H459785440\">",
"      <span class=\"h1\">",
"       What else can we do?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Trying to get pregnant can be tough on couples. People can feel sad, worried, angry, or guilty. It is important to get help for these feelings. You might find it helpful to learn ways to relax, or to go to a support group for people who are trying to get pregnant.",
"     </p>",
