var title_f6_25_6548="2D TTE 2-chamber descending thoracic aorta";
var content_f6_25_6548=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F79701%7ECARD%2F60999&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F79701%7ECARD%2F60999&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Two-dimensional transthoracic echocardiogram (2D TTE) from a modified two-chamber view showing the descending thoracic aorta",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 207px; height: 384px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The descending thoracic aorta (T Ao) can be imaged from the apical two and four chamber view. Posterior angulation of the transducer (panel A) often opens the T Ao such that it can be seen in its long axis. Major pathology such as aneurysms can often be detected in this way. Anterior angulation in the apical two chamber view (panel B) demonstrates the proximal aortic arch (Ao).",
"    <div class=\"footnotes\">",
"     LA: left atrium; LV: left ventricle; rpa: right pulmonary artery.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Mildly dilated thoracic aorta",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 314px; height: 246px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The long axis precordial view shows slight dilation of the thoracic aorta (Th Ao).",
"    <div class=\"footnotes\">",
"     CS: coronary sinus.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
