" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Mechanical ventilation of adults in the emergency department",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?6/25/6554/contributors\">",
"     Authors",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?6/25/6554/contributors\">",
"     Peter Hou, MD",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?6/25/6554/contributors\">",
"     Amado Alejandro Baez, MD, MPH, FAAEM",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?6/25/6554/contributors\">",
"     Section Editor",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?6/25/6554/contributors\">",
"     Ron M Walls, MD, FRCPC, FAAEM",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?6/25/6554/contributors\">",
"     Deputy Editor",
